function heightEqualizer(a){var b=document.querySelectorAll(a)||"undefined";if(b){var c=0;b.forEach(function(a,b){console.log(a.offsetHeight),a.offsetHeight>c&&(c=a.offsetHeight),console.log(c)}),c>0&&b.forEach(function(a){a.style.height=c+"px"})}}